import React, { useState } from "react";
import "./Nav.css";

function Nav() {
  const [toggle, setToggle] = useState(true);

  return (
    <nav className="navbar">
      <h1>Ankur</h1>
      <div className={toggle ? "items-container" : "items-container-second"}>
        <ul className={toggle ? "nav-items" : "nav-items-second"}>
          <li>
            <a href="/work">Work</a>
          </li>
          <li>
            <a href="/about">About</a>
          </li>
          <li>
            <a href="/contact">Contacts</a>
          </li>
        </ul>
        <a
          href="#"
          className="toggle-button"
          onClick={() => {
            console.log("click ho raha hai");
            setToggle(!toggle);
          }}
        >
          <span className="bar"></span>
          <span className="bar"></span>
          <span className="bar"></span>
        </a>
      </div>
    </nav>
  );
}

export default Nav;
